import Link from 'next/link';

const NavBar = () => (
  <div>
    <ul>
      <li>
        <Link href="/">Home</Link>
      </li>
      <li>
        <Link href="/about">About</Link>
      </li>
    </ul>

    <style jsx>{`
      ul {
        background: #333;
        list-style: none;
        display: flex;
      }

      ul li {
        font-size: 18px;
        margin-right: 20px;
      }

      ul li a {
        text-decoration: none;
        color: #fff;
      }
    `}</style>
  </div>
);

export default NavBar;
